    data: |
      SELECT DISTINCT + col2 FROM tab0 (FORMAT parquet) WHERE - 31 + - + ( + col1 ) + col0 + 80 * + col2 - 66 - - 58 IS NOT NULL;
  - name: tab0

outputs:
  - name: q7375.out
    data: |
      10
      47
      99
